import React from 'react'

function comment(props) {
    return (
        <div>
            <img src={`https://graph.facebook.com/v3.2/${props.comment.publisher.id}/picture`} />
            <span>{props.comment.publisher.name}</span>
        </div>
    )
}

export default comment
